import React, {Component} from 'react';
import './ToDoList.css';

class todolist extends Component {
    onInputChange = (event) => {
        console.log(event.target.value)
    }

    render () {
        return (
            <div className='ToDoList'>
                <input onInputChange={this.onInputChange} placeholder='Enter the task'/>
                <button>Enter</button>
                <ul>
                </ul>

            </div>
        )
    }

}

export default todolist;
